import app from "../firebase";
import { getStorage, ref, uploadBytes, getDownloadURL } from "firebase/storage";
import { useEffect, useState } from "react";
import { db } from "../firebase";
import { collection, addDoc, doc, getDoc } from "firebase/firestore";

// Get a reference to the storage service, which is used to create references in your storage bucket
const storage = getStorage();

// Create a storage reference from our storage service
// const storageRef = ref(storage);
// const imagesRef = ref(storage, "images");
// const mountainImagesRef = ref(storage, "images/mountains.jpg");

const AddProductForm = () => {
  async function fff() {
    const file = front;
    const fileName = file.name;
    const storageRef = ref(storage, `images/${fileName}`);
    await uploadBytes(storageRef, file).then((snapshot) => {
      console.log("Uploaded a blob or file!");
      // console.log(snapshot);
    });
    let asd;
    await getDownloadURL(storageRef).then((url) => {
      asd = url;
    });
    return asd;
  }

  async function bbb() {
    const file = back;
    const fileName = file.name;
    const storageRef = ref(storage, `images/${fileName}`);
    await uploadBytes(storageRef, file).then((snapshot) => {
      console.log("Uploaded a blob or file!");
      // console.log(snapshot);
    });
    let asd;
    await getDownloadURL(storageRef).then((url) => {
      asd = url;
    });
    return asd;
  }

  const handleSubmit = async (e) => {
    e.preventDefault();

    const frontImage = await fff();
    const backImage = await bbb();

    await addDoc(collection(db, "products"), {
      ...object,
      //
      images: ["https://picsum.photos/800/800", "https://picsum.photos/800/801", "https://picsum.photos/800/802"],
      frontImage,
      backImage,
      // categories: () => [...sex, ...this.category, ...this.podcategory, ...this.colors, ...this.sizes],
      categories: xd(),
    });
  };

  const object = {
    //     frontImage: "/static/media/wj1front.bda8c6ea.webp",
    //     backImage: "/static/media/wj1back.bac32f9d.webp",
    //     name: "Wide leg jeans",
    //     price: "39.99",
    //     sex: ["women"],
    //     category: ["trousers"],
    //     podcategory: ["jeans"],
    //     colors: ["blue"],
    //     sizes: ["M", "L"],
  };

  const xd = () => [...object.sex, ...object.category, ...object.podcategory, ...object.colors, ...object.sizes];

  const [front, setFront] = useState(null);
  const [back, setBac] = useState(null);

  const setFrontImage = async (e) => {
    console.dir(e.target.files);
    setFront(e.target.files[0]);
  };

  const setBackImage = async (e) => {
    console.dir(e.target.files);
    setBac(e.target.files[0]);
  };

  return (
    <div>
      <form onSubmit={(e) => handleSubmit(e)}>
        <input type="file" onChange={(e) => setFrontImage(e)} />
        <input type="file" onChange={(e) => setBackImage(e)} />
        <input type="submit" />
      </form>
    </div>
  );
};

export default AddProductForm;

